cale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"13057","type":"CustomJS"},{"attributes":{},"id":"12827","type":"BasicTickFormatter"},{"attributes":{"line_alpha":{"value":0.2},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"13024","type":"Segment"},{"attributes":{},"id":"12731","type":"LinearScale"},{"attributes":{},"id":"12773","type":"LinearScale"},{"attributes":{"coordinates":null,"data_source":{"id":"12838"},"glyph":{"id":"12839"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"12841"},"nonselection_glyph":{"id":"12840"},"view":{"id":"12843"}},"id":"12842","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"group":null},"id":"13088","type":"Title"},{"attributes":{},"id":"12858","type":"Selection"},{"attributes":{},"id":"13211","type":"StringEditor"},{"attributes":{"line_alpha":{"value":0.1},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"13023","type":"Segment"},{"attributes":{"data":{"Close":{"__ndarray__":"AAAAANj0VEEAAAAAH9VUQQAAAACt71RBAAAAQGMJVUEAAACASwRVQQAAAMDNV1VBAAAAALxcVUEAAABArV9VQQAAAAB7VlVBAAAAANCDVUEAAABAqbxVQQAAAEApsFVBAAAAAPNHVUEAAADAQR9VQQAAAADcNFVBAAAAAI6bVEEAAADAEwhUQQAAAEDs
